import React from 'react'
import './myStyles.css'

function Stylesheet(props) {
    
    let className;

    if (props.primary == true){
        className="primary"
    }
    else{
        className = ""
    }
    
    return (
        <div>
            <h1 className={className}>Stylesheets</h1>
        </div>
    )
}

export default Stylesheet
